def solve_sudoku(board):
    def is_valid(row, col, num):
        # Check if num is not in the same row
        for j in range(9):
            if board[row][j] == num:
                return False
        # Check if num is not in the same column
        for i in range(9):
            if board[i][col] == num:
                return False
        # Check if num is not in the same 3x3 subgrid
        subgrid_row = row // 3
        subgrid_col = col // 3
        for x in range(3):
            for y in range(3):
                if board[subgrid_row + x][subgrid_col + y] == num:
                    return False
        return True

    def solve():
        # Find the next empty cell
        for i in range(9):
            for j in range(9):
                if board[i][j] == '.':
                    # Try all possible numbers
                    for num in range(1, 10):
                        if is_valid(i, j, num):
                            board[i][j] = num
                            result = solve()
                            if result is not None:
                                return result
                            board[i][j] = '.'  # Backtrack
                    # If no possible number found, backtrack
                    return None
        # All cells filled
        return board

    solve_sudoku(board)
    return board
